import React, { Component } from 'react';
import {Consumer} from './Context'



class FileC extends Component {
    state = {  }
    render() { 
        return (
            <Consumer>
                {(greeting) => {
                    return <div>
                        my greeting is {greeting}
                    </div>
                }}
            </Consumer>
          );
    }
}
 
export default FileC;
